import React,{useState} from 'react'
import styled from 'styled-components'



const Navbar = styled.div`
background-color: black;
color:white;
display:flex;
justify-content:space-between;
padding:1%;
width:100%;
`
const Way = styled.ul`
display:flex;
justify-content:space-around;
`
const Menu = styled.nav`
            height: 100vh;
            position: absolute;

            top:0; 

            left: ${props=> props.cssvalue};
            overflow: hidden;
            z-index: 1;
            display: flex;
            align-items: center;
            justify-content: center;
            background-color: rgb(65, 64, 64);
            width: 100%;
            flex-direction: column;
            transition: 1s;
            text-align: center;

`
const MenuUl= styled.ul`
display:flex;
flex-direction:column;

`
const Logo = styled.div`
color:white;
font-family: sans-serif;

`



function Nav(){
const closemenu =()=>{
    setcssvalue('-100vw')
    console.log(cssvalue);
}
const openmenu =()=>{
    setcssvalue('0')
    console.log(cssvalue);
}
const [cssvalue, setcssvalue] = useState('-100vw');




return(
<>


<div class=" gayab">
       <Logo>
            IOE ASPIRANTS
      </Logo>
            <Menu cssvalue={cssvalue}>
                  <MenuUl>
                  <li><a href="#" >HOME</a></li>
                  <li><a href="#" >ABOUT US</a></li>
                  <li><a href="#" >PAYMENT</a></li>
                  <li><a href="#" >CONTACT US</a></li>
                  
                  </MenuUl>
                  <i class="fa fa-times fa-3x" aria-hidden="true" onClick={closemenu}></i>
            </Menu>
                  <i class="fa fa-bars fa-3x" aria-hidden="true" onClick={openmenu}></i>
           
</div>
    
    
<div class="navbar">
            <div class="logo">
            IOE ASPIRANTS
           </div>
            <div class="link">
                  <ul>
                        <li><a href="#">Home</a></li>
                        <li><a href="#">About Us</a></li>
                        <li><a href="#">Contact Us</a></li>
                        <li><a href="#">Payment</a></li>
                  </ul>

            </div>


  </div>
<div class="bye">
hello
</div>




</>




)


}
export default Nav
